import React from "react"; // rafce is shortcut
import { Typography, Avatar, Grid, Box } from "@material-ui/core";
import Typed from "react-typed";
import { makeStyles } from "@material-ui/core/styles";
import avatar from "../img/me.jpg";

// CSS STYLES
const useStyles = makeStyles((theme) => ({
  typedContainer: {
    // box that holds everything to center things
    width: 250,
    background: "#511",
    height: "100%",
  },
  avatar: {
    display: "block",
    margin: theme.spacing(1),
    width: theme.spacing(15), // different way to set size of avatar pic
    height: theme.spacing(15),
  },
  title: {
    color: "tomato",
  },
  subtitle: {
    color: "tan",
    marginBottom: "3rem",
  },
}));

const Header = () => {
  const classes = useStyles();
  return (
    <Box>
      <Avatar className={classes.avatar} src={avatar} alt="kelly he" />
      <Typography className={classes.title} variant="h4">
        <Typed strings={["hey i'm kelly"]} typeSpeed={80}></Typed>
      </Typography>
      <Typography className={classes.subtitle} variant="h5">
        <Typed
          strings={["yeet", "howdy do", "what's your favorite color?"]}
          typeSpeed={60}
          loop
        ></Typed>
      </Typography>
    </Box>
  );
};

export default Header;

